description:
Understanding Karate Do represents years of research, training, and teaching. Karate is certainly an exciting and rewarding holistic pursuit practiced by millions around the world. Whether you are an existing or prospective student of martial arts, there is always something new to learn! The general learning curve intended is for body mechanics, mental discipline, and ethical precepts to be practiced in the first phases of training. After such training, application of principles, mental focus, and personal development may be assisted. This edition of the book makes corrections and contains some newer materials. Supplementary resources also included.
